We can apply the CYK method bottom‐up to the string of length 8.  Label positions 1–8 with the nonterminals that generate each terminal:

1:t0⇒{NT14}
2:t161⇒{NT22}
3:t16⇒{NT28}
4:t89⇒{NT15}
5:t64⇒{NT14}
6:t181⇒{NT19}
7:t53⇒{NT20,NT21}
8:t157⇒{NT16}

Compute spans of length 2,3,…; one finds that no nonterminal covers any span of length 4 or more, and in particular no split (1…k)|(k+1…8) gives NT27 or NT32 on the left covering 1…k (nor NT32 on 1…k and NT15 on k+1…8).  Hence neither S→NT27 NT5 nor S→NT32 NT15 can build the full length‐8 string.  So the string is not in the language.  

No

After computing the CYK table on the terminals:

pos 1 = {NT31}  
pos 2 = {NT25}  

—and checking all binary rules A → B C—there is no rule with B=NT31 and C=NT25, so no nonterminal can derive the span (1,2).  Hence the whole string cannot be derived from S.  

No
